                scroll: false,
                stack: '.oskari-flyout',
                create: function (event, ui) {
                    /* IE8 works fine BUT IE9 needs fixed width to not jump flyout width during and after dragging */
                    if (jQuery.browser.msie && jQuery.browser.version[0] === "9") {
                        flyout.css('width', flyout.width() + "px");
                    }
                },
