        //var tabs = this.ui.find('> div.tab-content');
        var tabs = this.ui.children().children('div.tab-content');
        tabs.hide();
        
        var headerContainer = this.ui.find('ul li select');
        var options = headerContainer.find('option');
        options.removeAttr('selected');
